import React, { Component } from "react";
// import { Link } from "react-router-dom";
import Banner from "./../Element/Index3Slider";

import Header2 from "./../Layout/Header2";
// import Header from "./../Layout/Header";
import Footer2 from "./../Layout/Footer2";
// import Tab from "./../Pages/Tab";
// import Owl2 from "./../Element/Owl2";

var img1 = require("./../../images/overlay/pt1.jpg");

class Index3 extends Component {
  render() {
    return (
      <div>
        <div className="page-wraper font-barlow">
          <Header2 />

          <Banner />

          <div
            className="section-full content-inner bg-white"
            style={{ backgroundImage: "url(" + img1 + ")" }}
          >
            {/* <Tab /> */}

            <div className="container">
              <div className="marriage-head">
                <h5 style={{ color: "#5fcac7" }}>
                  Royal wedding destination in Jaipur- Pink Pearl
                </h5>
                <p style={{ color: "rgb(127 118 118)" }}>
                  Your special day calls for a celebration at a Special
                  location. So, here’s a glance at some of the reasons why Pink
                  Pearl makes for a superb option to host wedding functions
                </p>
              </div>
              <div className="row">
                <div className="col-lg-8">
                  <div className="marriage-image">
                    <img
                      src={require("./../../images/product/marriage/marriage-1.jpg")}
                      alt=""
                      // style={{ height: "421px", objectFit: "cover" }}
                    />
                  </div>
                </div>
                <div className="col-lg-4">
                  <p className="text-justify" style={{ color: "#4b5560" }}>
                    We have a capacious location which spreads across 65,376 sq.
                    ft. of land. For hosting pre-wedding and other wedding
                    functions, the spacious hall and lush green garden area is
                    perfectly suitable for a huge-sized gathering. Whether the
                    wedding functions consist of 10 guests or 2,000, the venue’s
                    open-air wedding set up can host ceremonies beautifully.
                    This location for Destination wedding in Jaipur has a huge
                    lawn area with a seating capacity of approximately 3000
                    guests.
                  </p>
                </div>
              </div>
            </div>
          </div>
        </div>
        <Footer2 />
      </div>
    );
  }
}

export default Index3;
